        <div>
            <Particles
    params={{
	    "particles": {
	        "number": {
	            "value": 50
	        },
	        "size": {
	            "value": 3
	        }
	    },
	    "interactivity": {
	        "events": {
	            "onhover": {
	                "enable": true,
	                "mode": "repulse"
	            }
	        }
	    }
	}} />
    <h1> Sumit Sjinde</h1>
        <Link  to={`/join`} >
        <button type = "submit">Click here</button>
        </Link>
        </div>
    );
}

export default Landing;
